(function (root, factory) {
    if (!window.jQuery)
        return;
    if (typeof define === 'function' && define.amd) {
        define(factory);
    } else if (typeof exports === 'object') {
        module.exports = factory();
    } else {
        root.tcpEasterEggs = factory();
    }
})(this, function () {
    var tcpEasterEggs = {};

    tcpEasterEggs.version = '1.0.3';

    var Settings = tcpEasterEggs.settings = {
        ghostCount: 85,
        ghostSpawnDuration: 15,
        ghostMinHeight: 75,
        ghostMaxHeight: 350,
        ghostMinLifeSpan: .5,
        ghostMaxLifeSpan: 10,
        friendHeight: 250,
        friendLifeSpan: 6,
        friendPctVisible: 0.75,
        idleFriendsEnabledChance: 15,
        showFriendIdleTimeout: 30,
        showFriendActiveInterval: 5,
        banishFriendsOnActivity: true
    };

    var friends = [
        'data:image/png;base64,',
        'data:image/png;base64,'
    ];

    tcpEasterEggs.configure = function (options) {
        var key, value;
        for (key in options) {
            value = options[key];
            if (value !== undefined && options.hasOwnProperty(key)) Settings[key] = value;
        }
        return this;
    };

    tcpEasterEggs.makeFriend = function (friend) {
        friends.push(friend);
    };

    //
    // Boo. trigger ghosts to spawn!
    tcpEasterEggs.spawnGhosts = function () {
        var i = 0;

        var spawnTimespan = Settings.ghostSpawnDuration;
        var ghostCount = Settings.ghostCount;

        while (i++ < ghostCount) {
            setTimeout(function () {
                spawnGhost();
            }, RandomInt(0, spawnTimespan * 1000));
        }
    };

    var displayedFriends = [];

    tcpEasterEggs.popupFriend = function () {
        var friendHeight = Settings.friendHeight;
        var friend = createFriend(friendHeight);
        var $el = $(friend);

        var friendDuration = Settings.friendLifeSpan * 1000;

        $el.show();

        $el.css('opacity', '1');

        var side = RandomInt(1, 4);

        var c1 = RandomCoordinate();

        var minX = c1.minX;
        var maxX = c1.maxX;
        var minY = c1.minY;
        var maxY = c1.maxY;

        var rX = RandomInt(minX, maxX - friendHeight);
        var rY = RandomInt(minY, maxY - friendHeight);

        var startingY;
        var endingY;
        var startingX;
        var endingX;

        var pctVisible = Settings.friendPctVisible;

        if (side === 1) { // top
            startingY = minY - friendHeight;
            endingY = startingY + friendHeight * pctVisible;
            startingX = endingX = rX;

            $el.css('transform', "rotate(180deg)");
        }
        else if (side === 2) { // right
            startingY = endingY = rY;
            startingX = maxX;
            endingX = maxX - friendHeight * pctVisible;

            $el.css('transform', "rotate(270deg)");
        }
        else if (side === 3) { // bottom
            startingY = maxY;
            endingY = maxY - friendHeight * pctVisible;
            startingX = endingX = rX;
        }
        else if (side === 4) { // left
            startingY = endingY = rY;
            startingX = minX - friendHeight;
            endingX = friendHeight * pctVisible - friendHeight;

            $el.css('transform', "rotate(90deg)");
        }

        $el.css('top', startingY).css('left', startingX);

        displayedFriends.push($el);

        $el.animate({ top: endingY, left: endingX }, friendDuration / 2, 'swing', function () {
            $el.animate({ top: endingY, left: endingX }, 1500, 'swing', function () {
                $el.animate({ top: startingY, left: startingX }, friendDuration / 2, 'swing', function () {
                    document.body.removeChild(friend);
                });
            });
        });
    };

    //
    // Hide any visible friends on the screen
    function banishFriends() {
        displayedFriends.forEach(function (el) {
            el.animate({ opacity: 0 }, 100);
        });
        displayedFriends = [];
    }

    /*************************************
     * Ghost/Friend Spawn Helper functions
     *************************************/
    function spawnGhost() {
        var ghost = createGhost();
        var $el = $(ghost);

        $el.show();

        var c1 = RandomCoordinate();
        var c2 = RandomCoordinate();

        var x1 = c1.randomX;
        var y1 = c1.randomY;

        var x2 = c2.randomX;
        var y2 = c2.randomY;

        var mx = (x1 + x2) / 2;
        var my = (y1 + y2) / 2;

        var minLifeSpan = Settings.ghostMinLifeSpan * 1000;
        var maxLifeSpan = Settings.ghostMaxLifeSpan * 1000;

        var duration = RandomInt(minLifeSpan, maxLifeSpan);

        $el.css('opacity', '0');
        $el.css('top', y1).css('left', x1);

        $el.animate({ opacity: '1', top: my, left: mx }, duration / 2, 'linear', function () {
            $el.animate({ opacity: '0', top: y2, left: x2 }, duration / 2, 'linear', function () {
                document.body.removeChild(ghost);
            });
        });
    }

    function createGhost() {
        var div = document.createElement('div');

        //
        // The ghost image is the first element
        var base64Data = friends[0];

        var minHeight = Settings.ghostMinHeight;
        var maxHeight = Settings.ghostMaxHeight;

        var height = RandomInt(minHeight, maxHeight);

        div.innerHTML = "<img height='" + height + "' src='" + base64Data + "'/>";
        div.style.opacity = 0;
        div.style.display = 'none';
        div.style.position = 'absolute';
        div.style.zIndex = 9999 + height;

        document.body.appendChild(div);

        return div;
    }

    function createFriend(height) {
        var div = document.createElement('div');

        var base64Data = friends[RandomInt(0, friends.length - 1)];

        div.innerHTML = "<img height='" + height + "' src='" + base64Data + "'/>";
        div.style.opacity = 0;
        div.style.display = 'none';
        div.style.position = 'absolute';
        div.style.zIndex = 9999 + height;

        document.body.appendChild(div);

        return div;
    }

    /*************************************
     * End Ghost Spawn Helper functions
     *************************************/


    /*************************************
     * Helper functions
     *************************************/

    //
    // Return a random int between min & max (inclusive)
    function RandomInt(min, max) {
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }

    //
    // Return a random coordinate on the visible page
    function RandomCoordinate() {
        var doc = document.documentElement;
        var left = (window.pageXOffset || doc.scrollLeft) - (doc.clientLeft || 0);
        var top = (window.pageYOffset || doc.scrollTop) - (doc.clientTop || 0);

        var w = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);
        var h = Math.max(document.documentElement.clientHeight, window.innerHeight || 0);

        var minX = left;
        var maxX = w;
        var minY = top;
        var maxY = top + h;

        var rX = RandomInt(minX, maxX);
        var rY = RandomInt(minY, maxY);

        return {
            minX: minX,
            maxX: maxX,
            minY: minY,
            maxY: maxY,
            randomX: rX,
            randomY: rY
        };
    }
    /*************************************
     * End Helper functions
     *************************************/


    if (window.addEventListener) {
        //
        // Add the hook for keyboard input
        var s = 0, k = [38, 38, 40, 40, 37, 39, 37, 39, 66, 65];
        window.addEventListener("keydown", function (e) {
            if (e.keyCode === k[s]) s++;
            else s = 0;
            if (s === k.length) { tcpEasterEggs.spawnGhosts(); s = 0; }
        }, true);

        //
        // Idle timeout easter egg!
        (function () {
            //
            // See if the idle friends will be enabled on this page
            if (RandomInt(1, 100) > Settings.idleFriendsEnabledChance) return;

            console.log("Boo.");

            var time;
            window.onload = resetTimer;
            window.onmousemove = resetTimer;
            window.onkeypress = resetTimer;

            function resetTimer() {
                if (Settings.banishFriendsOnActivity)
                    banishFriends();

                clearTimeout(time);
                time = setTimeout(timerTrigger, Settings.showFriendIdleTimeout * 1000);
            }

            function timerTrigger() {
                tcpEasterEggs.popupFriend();
                time = setTimeout(timerTrigger, Settings.showFriendActiveInterval * 1000);
            }

        })();
    }

    return tcpEasterEggs;
});